import React from 'react';

const RequestLearningPlan = () => {
  return (
    <div>
      <h2 className="centered-heading">Request Learning Plan</h2>
      <p>Request a personalized learning plan for technical upskilling.</p>
      <form>
        <label htmlFor="technology">Select Technology:</label>
        <select id="technology">
          <option value="tech1">Technology 1</option>
          <option value="tech2">Technology 2</option>
        </select>
        <label htmlFor="improvement">Areas of Improvement:</label>
        <input type="text" id="improvement" />
        <label htmlFor="goals">Learning Goals:</label>
        <input type="text" id="goals" />
        <button type="submit">Request Plan</button>
      </form>
    </div>
  );
};

export default RequestLearningPlan;
